(553, 6, 40, 69, 100, NULL, '提供豐富多元的體育賽事投注，包含足球、棒球、籃球、橄欖球...等全世界主要體育運動，並設計多元投注方式，例如足球類包含讓球和大小、全場半場、波膽、最先進球/最後進球…等，保證提供最即時的賽事結果，與24小時在線投注的客戶電話服務。', '提供丰富多元的体育赛事投注，包含足球、棒球、篮球、橄榄球...等全世界主要体育运动，并设计多元投注方式，例如足球类包含让球和大小、全场半场、波胆、最先进球/最后进球…等，保证提供最即时的赛事结果，与24小时在线投注的客户电话服务。', 'providing players diversified sportsbook bettings choices in worldwide main competitions including football, baseball, basketball and soccor games…etc. Take football for example; handicap, Over/Under, 1x2, predict, first/final goal score are provided and %s hereby also guarantee providing immediate game results meanwhile with 24 hours online services.', 'では、最も一般的なスポーツ種類はもちろん、色んな賭け種類も纏めました。当社はライブベッティングの情報を提供されており、ライブベットと電話サポート部門が年中無休で1日24時間、いつでも対応いたします。', '는(은) 축구, 야구, 농구, 미식축구를 포함한 스포츠 배팅 사이트로 전 세계적으로 보다 다양한 스포츠 게임、 배팅 종목 、신속한 게임 결과 그리고 24시간 온라인 배팅 문의 서비스등을 제공해 드리고 있습니다. 예 : 축구 핸디캡/하이로우/전반풀타임/정확한 점수 맞추기/첫골 마지막골 …등등', 'cập nhật đầy đủ tất cả giải đấu của các môn thể thao bao gồm Bóng Đá, Bóng Chày, Bóng Rổ, Bóng Bầu Dục….., Đồng thời cung cấp thể loại cược phong phú như Handicap & Over/Under, HT.FT, Điểm Số Chính Xác, Bàn Thắng Đầu/ Cuối …, %s đảm bảo luôn cập nhật kết quả trận đấu trực tiếp và tức thời. Và hỗ trợ trực tuyến 24/7 luôn sẵn sàng phục vụ quý khách.', NULL, 'providing players diversified sportsbook bettings choices in worldwide main competitions including football, baseball, basketball and soccor games…etc. Take football for example; handicap, Over/Under, 1x2, predict, first/final goal score are provided and %s hereby also guarantee providing immediate game results meanwhile with 24 hours online services.', 'para proporcionar una rica y diversa apuestas deportivas, como el fútbol, el béisbol, el baloncesto, el fútbol ... y así que lleva las apuestas deportivas del mundo y el diseño de diversas maneras, tales como balones de fútbol y dejar que la clase que contiene el tamaño de la audiencia media, Resultado correcto, el primer gol / último gol ... y así sucesivamente, para asegurar que la carrera para proporcionar los resultados más inmediatos, con 24 horas de servicio de apuestas telefónica al cliente en línea.', 1, 'toby', '2018-11-26 09:20:00', 'toby', '2018-11-26 09:20:00'),
(554, 6, 40, 69, 100, NULL, 'BBIN是一個可看見真實遊戲環境的娛樂平台，在這裡不僅可以體驗豐富有趣的百家樂遊戲，更可以與美麗的荷官共同在牌桌上鬥智力拼運氣。即時的現場、愉快的氣氛，%s超越了空間的限制將最真實真切的遊戲現場呈現在任何角落，帶來了休閒娛樂與視覺感官的完美結合。趕快加入！讓我們一起在真實與歡樂的Live遊戲中享受實況氣氛帶來的一切！', 'BBIN是一个可看见真实游戏环境的娱乐平台，在这里不仅可以体验丰富有趣的百家乐游戏，更可以与美丽的荷官共同在牌桌上斗智力拼运气。即时的现场、愉快的气氛，%s超越了空间的限制将最真实真切的游戏现场呈现在任何角落，带来了休闲娱乐与视觉感官的完美结合。赶快加入！让我们一起在真实与欢乐的Live游戏中享受实况气氛带来的一切！', 'BBIN is a game platform enable to see the real game environment. Players can not only experience the interesting Baccarat game but also battle wisdom and luck with pretty dealers on poker table. %s broke space constraints showing you real-time and pleasant atmosphere and bringing you the perfect combination of recreation and visual enjoyment by expressing the most realistic live game scenes. Let\'s enjoy %s and join us now!', 'BBINは真実な環境が見えることができるの娯楽のプラットフォームので、ここには豊かに面白いバカラを体験することができるだけではなくて、更にと美しいディーラーは共にポーカーで知力と運を戦うことができます。%sが空間の制限を越えて、ただちにの生中継、楽しい雰囲気と最も真実な現場が現れて、娯楽と視覚の完璧な結合を持ってきました。早く参加します！私達に一緒に真実で楽しいLiveゲームの中で実況の雰囲気の持ってくるすべてを享受すさせます！', 'BBIN는 실제 카지노를 연상 시키는 라이브 카지노 사이트로 재밌고 다양한 바카라 게임을 비롯해 다양한 게임은 물론이고, 아름다운 딜러와 함께 게임을 즐기 실 수 있습니다. 실시간 라이브 배팅, 유쾌한 분위기를 비롯해 %s는 시간과 공간의 제한을 뛰어 넘어 세계 어디서든 24시간 내내 즐기실 수 있는 레져 오락과 시각 게임의 완벽한 조합이라 할 수 있습니다. 더 이상 망설이지 마시고 간단한 회원가입으로 이 모든 혜택을 체험해 보시기 바랍니다.', 'BBIN là trang mạng với những trò chơi người thật, không chỉ có thể trải nghiệm với thế giới game phong phú, mà còn có thể cùng với mỹ nữ phát bài thử thách về trí lực và vận may. Hiện trường chân thật, không khí dễ chịu, sự vượt quá giới hạn không gian thật sự đem lại sự sống động cho trò chơi từ mọi góc độ, mang lại những giây phút thư giản và những cảm nhận giác quan thật tuyệt vời. Hãy nhanh chóng gia nhập với chúng tôi, để chúng tôi có thể mang lại bầu không khí chân thật, cùng nhau tận hưởng mọi niềm vui của trò chơi trực tuyến.', NULL, 'BBIN is a game platform enable to see the real game environment. Players can not only experience the interesting Baccarat game but also battle wisdom and luck with pretty dealers on poker table. %s broke space constraints showing you real-time and pleasant atmosphere and bringing you the perfect combination of recreation and visual enjoyment by expressing the most realistic live game scenes. Let\'s enjoy %s and join us now!', 'BBIN es un entorno de juego real que se puede ver en la plataforma de entretenimiento, donde se puede disfrutar la interesante bacará de suerte en la mesa de póquer. Escena inmediata, ambiente agradable,%s allá de los límites del espacio será la demostración de juego real en vivo más auténtico en cualquier esquina para traer la combinación perfecta de entretenimiento y los sentidos visuales. Ven y únete! Vamos a trabajar juntos para que el ambiente en vivo para disfrutar de todo el partido en vivo real y alegría!', 1, 'toby', '2018-11-26 09:20:00', 'toby', '2018-11-26 09:20:00'),
(555, 6, 40, 69, 100, NULL, '彩票遊戲玩法簡單、賠率多元，只要依據彩票獲勝組合且選擇想要下注的數字，開彩後即可獲知中獎相關資訊，包括中國本國3D彩、體彩排列三、上海時時樂、重慶時時樂、江西時時樂、天津時時樂及香港特區六合彩，所有彩票遊戲公正公開，皆參照各地官方開獎結果為依據，連線同步即時開彩。想要讓自己一夜致富的夢想成真嗎?不要錯過機會，下一個千萬富翁很可能就是您，趕緊登入帳號即可隨時參與其中。', '彩票游戏玩法简单、赔率多元，只要依据彩票获胜组合且选择想要下注的数字，开彩后即可获知中奖相关资讯，包括中国本国3D彩、体彩排列三、上海时时乐、重庆时时乐、江西时时乐、天津时时乐及香港特区六合彩，所有彩票游戏公正公开，皆参照各地官方开奖结果为依据，连线同步即时开彩。想要让自己一夜致富的梦想成真吗?不要错过机会，下一个千万富翁很可能就是您，赶紧登入帐号即可随时参与其中。', 'Lottery game is easy to play and has diversified odds. Only need to choose the numbers that you want to bet in the combinations. The player can get the winning information immediately after draw which includes China’s 3D Lotto, Sports Lotto, Shanghai Lotto, Chongqing Lotto, Jiangxi Lotto, Tianjin Lotto and HK Mark Six. All of the lottery games are fair and public. The results are according to the official side of every place, and we also connect with them to get the results immediately. Do you want your dreams come true? Then, don’t miss this chance. The next multimillionaire could be you so please login in and join us now!', '宝くじゲームは手軽いに遊べる、ベットレートも多様性、宝くじの勝組み合わせとベットしたい数字を選び、抽選した後はすぐに当選情報をもらえる、3D宝くじ(3D Lotto)、スポーツ宝くじ（Sports Lotto)、上海宝くじ（Shanghai Lotto）、重慶宝くじ（Chongqing Shishicai）、江西宝くじ（Jiangxi Lotto）、天津宝くじ（Tianjin Lotto）及マークシックス(HK Mark Six)を含みます。すべての宝くじゲームは公正公開、各地のホームページの抽選結果に基づいて、ライブで即時に抽選が行われます。自分が億万長者になる夢を叶えたい？このチャンスを見に逃げない、次の億万長者はあなた様でしょう、今すぐアカウントをログインして一緒に遊ぼう！', '복권게임은 게임 방법이 간단하며, 배당율 또한 다양하여 원하시는 번호를 선택하여 당첨 여부를 바로 확인하실 수 있습니다. 본 게임은 중국3D 복권, 체육복권, 상해시시락, 중경시시락, 강서시시락, 천진시시락 그리고 홍콩 마크식스 등의 게임이 포함되여 있으며, 모든 게임은 절대로 공정, 공평을 원칙으로 해당 지역의 공식 사이트에서 추첨한 번호를 기준으로 진행 하는 게임입니다. 돈벽을 맞고 부자가 되고 싶으신가요?? 이번 기회를 절대로 놓치지 마시기 바랍니다, 망설이지 마시고 지금 당장 로그인하여 복권 게임의 내용을 참조하시기 바랍니다….게임에 참여하는 즉시 다음 억만장자는 바로 당신일 수도 있습니다….', 'Game xổ số: cách chơi game xổ số đơn giản, tỷ lệ cược đa dạng , chỉ cần căn cứ vào tổ hợp thắng của xổ số để chọn lựa con số muốn đặt cược.Sau khi mở thưởng có thể biết ngay thông tin trúng thưởng.Game xổ số bao gồm: xổ số 3D Trung Quốc,xổ số thể thao hàng 3, xổ số Thư