(2129, 6, 40, 70, NULL, NULL, '提供超過百款豐富多元的老虎機遊戲，所有遊戲皆採自然機率RNG認證把關，產品穩定性高，帶給您最佳的遊戲體驗，樂此不疲。', '提供超过百款丰富多元的老虎机游戏，所有游戏皆采自然机率RNG认证把关，产品稳定性高，带给您最佳的游戏体验，乐此不疲。', 'We provide more than a hundred slot games which are based on RNG Certification. The stable games provide the best experience and you can enjoy them without getting tired.', '100種類以上のスロットゲームは、全部RNGの認証済みで公平性に保証あります。プレイヤーに最高の一時をお送りします。', '100종 넘은 다양한 슬롯게임을 제공하며 모든 게임은 자연기율 RNG 인증을 받았습니다. 안정적인 게임으로 최고의 체험을 제공해드리며  지치지 않게 즐기실 수 있습니다.', NULL, NULL, NULL, NULL, 1, 'jin', '2019-09-27 07:46:51', 'jin', '2019-09-27 07:46:51');
