(148, 1, 9, '首頁中間『累積獎池』的CNY會移除，且因公司規範數字將會調整為系統字。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(149, 1, 10, '因考慮左右延伸，首頁輪播和TITLE圖片背景兩側將作淡出處理。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(150, 1, 10, '首頁與內頁因考量背景左右延展性，左右將作刷淡處理', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(151, 1, 11, 'LOGO部分，提供LOGO原始檔與示意圖不同，請問要以哪個檔案為主？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(152, 1, 11, 'LOGO部分，站名與需求單不同，請問要以哪個為主？若以需求單為主，要煩請重新提供正確檔案', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(153, 1, 11, 'LOGO部分，業主檔案較小為146X98，放在套版用圖上會偏小，若要大一點要煩請重新提供檔案，建議尺寸400X200', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(154, 1, 11, 'LOGO動態要煩請提供FLA檔案好執行後續製作', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(155, 1, 11, 'LOGO部分，業主提供的FLA與版面PSD大小不同，因直接修改FLA動態會有所跑版，煩請提供正確大小的檔案以利製作。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(156, 1, 11, 'LOGO部分，示意圖、logo檔案、flash swf檔案，顏色質感皆不同，請問要以哪個為主?', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(157, 2, 12, '請問首頁及內頁的 Header 右上方的連結是否要移除，調整符合NBB的形式規範，日後即可在後台編輯自行維護。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(158, 2, 12, '網頁最大版寬為 1280px。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(159, 2, 12, '請問首頁下方兩個遊戲區塊，符合目前規範模塊中的「1+4圖塊板塊」與「1+2大小圖」模塊，但因設計上寬度已超出1280px的限制，請問是否調整符合規範模塊，以便日後後台可作維護，或維持目前設計1920px客製化寬度，則日後無法後邊編輯修改？(後續RD回覆因1920無法RWD因此建議調整為最大版寬1280)', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(160, 2, 12, '如選擇模塊，語系圖需改為公司制定樣式。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(161, 2, 12, '請問首頁此遊戲區塊，是否使用「自訂遊戲模塊」的佈局A樣式顯示？原遊戲Title：「熱門遊戲推薦」將也會保留(紅框的區塊)。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(162, 2, 12, '真人视讯.JPG、体育赛事.JPG 頁面，最上方的遊戲列表，將會在「圖塊模塊」新增一佈局，圖片間負推值為固定的，無法讓業主設定，而頁面內容寬度上也超出限制版寬1280px，將會調整寬度符合1280內，故呈現上會有些微的不同。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(163, 2, 12, '「電子遊藝」「棋牌遊戲」等遊戲頁面，內容將套用公司目前最新樣式。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(164, 2, 12, '目前導覽列功能無提供副標題的功能，首內頁的導覽列副標英文小字將需移除。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
