(167, 2, 12, '首頁超級彩金數字，因公司規範將會調整為系統字。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(168, 2, 12, '原在頁面底下footer區的「語系」功能將要移到header區塊中，請問要放置header中哪個位置？', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
(169, 2, 12, '登入後內容資訊，將按照公司規定內容套用。', 1, 'bbin', '2019-06-09 16:00:00', 'bbin', '2019-06-09 16:00:00'),
